script: |
  super -f text -I q12137.spq | sort > q12137.out

inputs:
  - name: q12137.spq
    data: |
      SELECT col1 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE NOT col0 NOT IN ( + 73 * col2 + + + CAST ( NULL AS INTEGER ) / - 65 + col1 + + col2, 88 + + 42 + + 18 );
  - name: tab1

outputs:
  - name: q12137.out
    data: |
